import React from "react";
import Skill from "./Skill.js";
export default class extends React.Component{
    state={
        cards:[{
                title:"Web Development",
                skills:["React","SCSS"],
            },
            {
                title:"Personal",
                skills:"Loving Jaymee",
            }
        ]
    }
    render(){
        return(
            this.state.cards.map(x=>(
                <Skill title={x.title}/>
            ))
            // <Skill/>
        );
    }
}
